import Link from 'next/link';

function Nav() {
  return (
    <div>
      <img src="./static/logo.png" alt="logo"/>
      <Link href="/">
        <a>Home</a>
      </Link>
      <Link href="/about">
        <a>about</a>
      </Link>
    </div>
  );
}

export default Nav;
